var request = require("sync-request");

function GetWatchData() {
  return JSON.parse(
    request("GET", "http://localhost:8000/api/homewatch/").getBody()
  );
}

function GetListenData() {
  return JSON.parse(
    request("GET", "http://localhost:8000/api/homelisten/").getBody()
  );
}

export { GetWatchData, GetListenData };
